One of the simplest fresh hand-rolled kinds of pasta to perfect, it is a fantastic starting point for every pasta lover.
I use a gnocchi board to create the traditional ridges but you can use anything with a ribbed texture.
Try using a sushi mat, the base of a crystal vase, the back of a microplane grater or simply roll these directly on your bench which results in a smooth but still delicious finish.
This shape is typical of the south of Italy where the dough is made from Semolina & water rather than eggs & 00 flour. This said the shape forms well regardless of what type of dough you use but you do need a firmer dough to avoid it from sticking to the ribs of your gnocchi board.
